import React from 'react';
import ReactDOM from 'react-dom';
import './styles/index.css'; // Importa tus estilos globales aquí si tienes un archivo CSS general
import App from './App';

// Monta el componente `App` en el div con id "root" en `public/index.html`
ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
